import React from 'react';
import classes from './OpenCard.module.css';

export default function OpenCard(props) {
    return (
        <div
            className={classes.OpenCard}>
            <div 
                className={classes.Placeholder}>
                <div>
                    Image
                </div>
                <div>
                    X
                </div>
            </div>
        </div>
    );
}
